import React,{useState,useEffect} from 'react'
import { useSelector,useDispatch } from 'react-redux';
import {fetchData} from '../../actions/Seller';

const Customer = () => {

    const dispatch = useDispatch();
    const seller_Details = useSelector((state) => state.allSeller);
    console.log(seller_Details);
    useEffect(() => {
        dispatch(fetchData);
    },[]);


    return (
        <div>
            <h2>Seller Details</h2>
            {seller_Details.map((seller) => {
                <div>
                <p>{seller.name}</p>
                <p>{seller.email}</p>
                <p>{seller.number}</p>
                <p>{seller.type}</p>
                <p>{seller.pincode}</p>
                </div>
            })}
        </div>
    )
}

export default Customer
